import React from 'react'
//import './CommentView.css'

export default class CommentView extends React.Component {


    render() {
        let userName=this.props.users.username.filter(this.props.comments.user_id == this.props.users.id)
        return (
            <div id="articleComment">
                <h3>{userName}</h3><p>{this.props.article.text}</p></div>
        );
    }
}
